import React from 'react';
import { Typography } from 'antd';
import UploadProduct from '../global/Upload/UploadProduct';
const { Title } = Typography;

const Profile = () => {
  return (
    <div>
      <Title type='secondary'> Perfil </Title>
      <UploadProduct />
    </div>
  );
};

export default Profile;
